the East Side Kids in Bowery Champs - 1944

Featuring Leo Gorcey, Bobby Jordan, Huntz Hall, Billy Benedict, Gabriel Dell, Jimmy Strand &amp; Buddy Gorman.

A murder mystery. Bobby Jordan appears in uniform &amp; uses his real name in the flick, Bobby was in the service at this point, must of been on leave or something. Gabriel Dell plays a role outside of the gang.

Good flick. Also, Leo's dad Bernard Gorcey plays a cabbie
